import React from "react";
import { useState } from "react";
import { View, Alert, Text, Image, FlatList, TouchableOpacity  } from "react-native";
import Background from "../../components/Background/Background";
import styles from "./AppointmentStyle";
import PendingAppointmentsList from "./components/PendingAppointments";
import AcceptedAppointmentsList from "./components/AcceptedAppointments";

const Appointment = ({navigation} ) => {

  const APPOINTMENT_STATUS = {
    PENDING: "PENDING",
    ACCEPTED: "ACCEPTED"
  }

  const Items = [
    {
      Name: "Towing Service",
      Time: "18/01/2021, 2.00pm",
      Photo: "data:image/jpeg;base64,"
    },
    {
      Name: "Towing Service",
      Time: "22/01/2021, 12.00pm",
      Photo: "data:image/jpeg;base64,"
    }
  ];

  const Accepted = [
    {
      Name: "Towing Service",
      Time: "16/01/2021, 2.00pm",
      Photo: "data:image/jpeg;base64,"
    },
    
    {
      Name: "Changing Battery",
      Time: "21/01/2021, 16.00pm",
      Photo: "data:image/png;base64,"
    }
  ];

  const tabs = {
    "PENDING": "Pending",
    "ACCEPTED": "Accepted"
  }
  const [tab, setTab] = useState(tabs.PENDING);
  const triggerTab = (tabSelected) => {
    setTab(tabSelected);
  }

  return (
    <Background>
      <View style={styles.container}>
        <View style={styles.buttoncon}>
          <TouchableOpacity 
            style={styles.button}
            onPress={() => {
              console.log(tabs.PENDING)
              triggerTab(tabs.PENDING)
            }}
          >
            <Text>{tabs.PENDING}</Text>
          </TouchableOpacity>
          <TouchableOpacity 
            style={styles.button}
            onPress={() => {
              console.log(tabs.ACCEPTED)
              triggerTab(tabs.ACCEPTED)
            }}
          >
            <Text>{tabs.ACCEPTED}</Text>
          </TouchableOpacity>
        </View>
        <View>
          {Boolean(tab === tabs.PENDING) && (
            <PendingAppointmentsList statuses={APPOINTMENT_STATUS} />
          )}
          {Boolean(tab === tabs.ACCEPTED) && (
            <AcceptedAppointmentsList statuses={APPOINTMENT_STATUS} />
          )}
        </View>
      </View>
    </Background>
  );
};

export default Appointment;